                                    if(auxTweens == 0 ){
                                        auxTweens++
                                        gameState.explore = false
                                        this.player.play({key: userCharacter_animationsKey.walk_up.key, repeat: 1}, false)
                                        
                                        const tweens_walkUp =  this.tweens.add({
                                            targets: this.player,
                                            y: playerState.targetY,
                                            duration: 500,
                                            ease: 'Linear',
                                            onComplete: () => {
                                                tweens_walkUp.destroy()
