                                                        playerState.targetY = Math.floor(target.y * mapMain_scale)
                                                        this.player.play({key: userCharacter_animationsKey.walk_down.key, repeat: 0}, true)


                                                        this.time.addEvent({
                                                            delay: 1200,
                                                            callback: () => gameState.isPlayerAbleToMove = true,
                                                            loop: false
                                                        })
                                                    }
                                                }).play()
                                            },
                                            repeat: 0,
                                            yoyo: false
                                        }).play()
                                    }
                                break

